import React, {useEffect, useState} from 'react';

const Tabs = () => {

    const [tab, setTab] = useState();

    return (
        <div>
            <div class="tab-bar">
                <ul>
                    <li><a href="">Tracker</a></li>
                    <li><a href="">Home Stats</a></li>
                    <li><a href="">Away Stats</a></li>
                </ul>
            </div>
            <div>
                <h3>
                    This will be the tabable data table section...
                </h3>
            </div>
        </div>
    )
}

export default Tabs;
